import {BrowserRouter as Router, Switch, Route} from 'react-router-dom';

function App() {

  return (

    <div>
        <Nav />
      <div className='App'>
        <PositionMap />
        <MainPollinationGraphs />
      </div>
    </div>

  );
}
export default App;
